import {createMuiTheme} from '@material-ui/core';

const theme = createMuiTheme({
    palette: {
        typography: {
            fontFamily: 'Montserrat',
        },
        primary: {
            main: '#a57f60',
        },
        secondary: {
            main: '#e8ae68'
        },
        button: {
            main: '#db5a42'
        },
        text: {
            primary: '#fbfbfb',
        }
    },

});

export default theme;
